INSERT INTO `tipo_doc` (`id`, `nome`, `descricao`, `data_criacao`, `data_alteracao`) VALUES
(1, 'CARTA', '', '', ''),
(2, 'CONVITE', '', '', ''),
(3, 'ATA', 'Documento de valor jurídico, que consiste em registro narrativo fidedigno e decisões do que passou em uma assembleia, sessão ou reunião. Pode ser lavrada em livro próprio, autenticado, com páginas num', '', ''),
(4, 'ATESTADO', 'Documento firmado por servidor em razão do cargo que ocupa, ou função que exerce, declarando um fato existente, mas que não consta em livros, papéis ou documentos em poder da Administração.', '', ''),
(5, 'CERTIDÃO', 'Documento fornecido pela administração ao interessado, afirmando a existência de ato ou assentamentos constantes de processo, livro ou documentos que se encontrem nas repartições públicas. Pode ser de', '', ''),
(6, 'COMUNICADO', 'O comunicado é um tipo de aviso ou recado oficial, que é utilizado com o objetivo de passar uma determinada informação. Uma empresa, um colégio, órgãos da administração pública, entre outros costumam ', '', ''),
(7, 'CIRCULAR', 'Correspondência de caráter interno da Instituição, expedida simultaneamente a diversos destinatários, com o objetivo de transmitir rotinas, orientações, procedimentos, esclarecer o conteúdo de leis, n', '', ''),
(8, 'CONVOCAÇÃO', 'Convocação é uma forma de comunicação escrita em que se convida ou chama alguém para uma reunião. Na elaboração do texto, é necessário especificar local, data, finalidade. A garantia da inteligibilida', '', ''),
(9, 'CONTRATO', 'Instrumento jurídico em que se firmam direitos e obrigações entre duas ou mais pessoas, sobre objeto lícito e possível, com o fim de adquirir, modificar, extinguir ou resguardar direitos. Contrato adm', '', ''),
(10, 'CONVÊNIO', 'Acordo bilateral e multilateral celebrado entre entidades públicas e outra ou outras entidades públicas ou privadas para realização de objetivos de interesse comum dos partícipes. Convênio é acordo, m', '', ''),
(11, 'DECISÃO', 'Pronunciamento final de autoridade administrativa competente. É competência dos Conselhos Superiores e Centros Universitários.', '', ''),
(12, 'DECLARAÇÃO', 'Documento firmado por servidor em razão do cargo que ocupa, ou função que exerce, declarando um fato existente, que consta em livros, papéis ou documentos em poder da Administração.', '', ''),
(13, 'DESPACHO', 'É a decisão proferida pela autoridade administrativa no caso submetido à sua apreciação. Pode ser informativo ou decisório. Usualmente, parte integrante de processo. Quanto ao seu conteúdo pode ser de', '', ''),
(14, 'EDITAL', 'Instrumento de comunicação utilizado pela Administração Pública para fins de abertura de concorrência e de concurso público, provimento de cargo público, convocação de servidor, licitações e divulgaçã', '', ''),
(15, 'MEMORANDO', 'Comunicação interna utilizada pelas chefias ou servidores autorizados, na qual se expõe qualquer assunto referente à atividade administrativa. Pelas suas características de certa informalidade, o memo', '', ''),
(16, 'NORMA DE SERVIÇO', 'Comunicação interna destinada a estabelecer os procedimentos básicos para o funcionamento e fixa a política de ação da Universidade. Aplica as diretrizes e os critérios estabelecidos na legislação e e', '', ''),
(17, 'OFÍCIO', ' Comunicação que as autoridades fazem entre si, entre subalternos e superiores, e entre a Administração e particulares, em caráter oficial. É o tipo mais comum de correspondência oficial. Embora norma', '', ''),
(18, 'ORDEM DE SERVIÇO', 'Ato interno, através do qual determinam instruções a respeito de procedimentos estabelecidos em Norma de Serviço e Resolução, em obediência à determinação prescrita nestas, ou para esclarecer os seus ', '', ''),
(19, 'PARECER', 'Estudo minucioso, redigido com clareza, documentado cientificamente, visando esclarecer a dúvida constitutiva do objeto de consulta.', '', ''),
(20, 'PROTOCOLO DE INTENÇÕES', 'Acordo bilateral celebrado entre a Universidade e outra entidade pública ou privada que querem fazer alguma parceria ou promover convênios, visando ações nas áreas de ensino, pesquisa e extensão. Assi', '', ''),
(21, 'REGULAMENTO', 'Ato normativo que constitui a lei do corpo administrativo a que se destina, sendo regra geral, produto de elaboração e revisão de Comissão instituída pelo Reitor. Constituída por servidores do próprio', '', ''),
(22, 'RELATÓRIO', 'Documento onde o servidor expõe a atividade de um órgão/setor ou presta conta de seus atos a uma autoridade, de nível hierárquico superior. Geralmente produzido para expor situações de serviço, result', '', ''),
(23, 'NOTA', '                          \r\n                        ', '', '2020-06-26'),
(24, 'PROPOSTA', '                          \r\n                        ', '2020-07-06', '');
